@Regjeringen og @jonasgahrstore sitter trygt, fordi Erna står for samme politikken.
Vi har et større demokratisk problem i Norge, enn #Fosendommen.
Når politikere flest er på så grov kollisjonskurs med velgerne, i så mange viktig saker - da snakker vi om grunnleggende farer.

Hvis du lurer på hvor *alle* politibilene i Oslo var på mandag, ser du svaret her 
