1) "#Fosendommen sier ikke at vi må rive"
2) "vi må ha skikkelig grunnlag for vedtakene vi gjør".

1) Jo! "Ulovlig oppført" = riv!
2) bedre grunnlag for vedtak enn @hoyesterett_no får du ikke!
